    marginTop:'-70px',
    fontSize:'50px',
    backgroundSize: 'cover',
    backgroundRepeat: 'no-repeat',
};
class ProductList extends Component {
    render() {
        return (
            <React.Fragment>

            <Helmet>
                <title>LiteCnC</title>
            </Helmet>
            <div class="hero">
            <div style={myStyle}>
                 <h1> geeksforgeeks </h1>
               </div>
                 <div class="hero-text">
                     <h1>Wanna Rent a car or a stay</h1>
                     <p>We provide a very affordable services from anywhere you are.</p>
                      <button>Book Now</button>
                 </div>
            </div>

            </React.Fragment>

        );
    }
}

export default ProductList;
